      <div>
          <Row>
              <h2>Letter Details</h2>
          </Row>
          <Row>
              <p>ID</p>
          </Row>
          <Row>
              <Col md={10}>Addressed from (Actual):</Col>
              <Col md={5}>Navigation Pane</Col>
              <Col md={2} className='navPane'>Navigation Pane</Col>
          </Row>

      </div>
    )
  }
}

export default LetterPg;
